import React from 'react';
import Button from '@mui/material/Button';
import ImageGrid from './ImageGrid';
function Get_Started() {
    return (
        <main style={{ display: 'flex', justifyContent: 'flex-end', alignItems: 'center', height: '100vh' }}>
            <ImageGrid />
            <Button
                variant="contained"
                style={{ fontSize: '4rem', backgroundColor: '#800080', color: '#fff', borderRadius: '50px', textTransform: 'capitalize', marginRight: '50px', fontFamily: 'Montserrat, sans-serif' }}
            >
                Welcome!
            </Button>

        </main>
    );
}

export default Get_Started;
